$.aj0=function(){var t=u.X
return P.D(["en","Currently, Studying Numbers supports 13 languages: English, German, French, Spanish, French, Indonesian, Italian, Japanese, Korean, Dutch, Polish, Russian, and Portuguese.\nIn these languages, \u200b\u200byou can see the conversion table, which in addition to direct conversion, you can hear the correct way to pronounce in the language.\nThe similarity and difference between these languages \u200b\u200bcan be seen in this language family tree diagram. Languages \u200b\u200bwith the same ancestor are part of the same linguistic family.\n\n\n","pt","Atualmente, o Studying Numbers suporta 13 idiomas: Ingl\xeas, Alem\xe3o, Franc\xeas, Espanhol, Franc\xeas, Indon\xe9sio, Italiano, Japon\xeas, Coreano, Holand\xeas, Polon\xeas, Russo e Portugu\xeas.\nNesses idiomas \xe9 poss\xedvel ver a tabela de convers\xe3o, que al\xe9m da convers\xe3o direta, \xe9 poss\xedvel ouvir a forma correta de pronunciar no idioma. \nA semelhan\xe7a e diferen\xe7a entre esses idiomas \xe9 poss\xedvel ver nesse diagrama de \xe1rvore de fam\xedlias lingu\xedsticas. Fazem parte de uma mesma fam\xedlia lingu\xedstica idiomas com um mesmo ancestral. \n \n\n  "],t,t)}()
$.aj1=function(){var t=u.X
return P.D(["en","We have at least two interesting information to highlight in this diagram:\n  - English is more like German and Dutch than any other language.\n  - English is more like Latin languages, and Russian or Korean is more like Japanese.\n\n\n","pt","  Temos pelo menos duas informa\xe7\xf5es interessantes a serem destacados nesse diagrama:\n  - O ingl\xeas \xe9 mais parecido com o alem\xe3o e hol\xe2ndes do que qualquer outra lingua.\n  - O ingl\xeas \xe9 mais parecido com as linguas latinas, e com o russo do que o coreano \xe9 parecido com o japon\xeas.\n\n\n  "],t,t)}()
